class ABG extends Component {
	render() {
		return(
			<div>
		<h1> Take Note !</h1>

<h3>This resource is a learning support to be used with appropriate clinical judgement and supervision.</h3>

<h1>Absolute contraindications</h1>
<ul>
<li>Overlying skin infections</li>
<li>Arterio-venous fistula</li>
<li>Arterial disease with inadequate circulation to the extremity</li>
</ul>

<h3>If you are unsure, ASK !</h3>
</div>
		);
	}
}

export default ABG;
